I got some questions on how we cook our rice after it’s soaked so I wanted to share our basic rice recipe. Like I said, it’s super basic, but my whole family loves it and it’s a great way to get some bone broth and healthy fats in. We typically use organic jasmine rice. After soaking the rice overnight, we rinse it and cook in bone broth instead of water with a tablespoon of grass fed butter.
.
Bone broth is absolutely incredible for us in so many ways, and it adds a ton of flavor as well. Once the rice is done, we usually add more grass fed butter (give me all the healthy fats) and some sea salt. @redmondrealsalt is my favorite!
.
I’d love to know, do you take the time to soak or sprout your grains? If you haven’t, try it and let me know what you think!";}i:160;a:1:{s:14:"comments_count";i:1;}i:161;a:1:{s:11:"likes_count";i:0;}i:162;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuK8OxgG0l";}i:163;a:1:{s:5:"image";s:259:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118849556_662761621010313_5996867801745286901_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=109&_nc_ohc=mS7iPQuempQAX8SgPX3&_nc_tp=15&oh=bdfd562ef51692beae721f41214e615a&oe=5F7CEED2";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:46632956;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2390896563330495398";}i:170;a:1:{s:10:"short_code";s:11:"CEuK8HABDOm";}i:171;a:1:{s:12:"created_time";i:1599237102;}i:172;a:1:{s:7:"caption";s:848:".
